import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Register from './components/Register';
import Login from './components/Login';
import UserDashboard from './components/UserDashboard';
import AdminDashboard from './components/AdminDashboard';
import ProtectedRoute from './components/ProtectedRoute';
import Games from './components/Games';
import ClimateSimulator from './components/games/ClimateSimulator';
import EcosystemBalance from './components/games/EcosystemBalance';
import ClimateHero from './components/games/ClimateHero';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route
          path="/user-dashboard"
          element={
            <ProtectedRoute>
              <UserDashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin-dashboard"
          element={
            <ProtectedRoute requireAdmin={true}>
              <AdminDashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/games"
          element={
            <ProtectedRoute>
              <Games />
            </ProtectedRoute>
          }
        />
        <Route
          path="/games/climate-simulator"
          element={
            <ProtectedRoute>
              <ClimateSimulator />
            </ProtectedRoute>
          }
        />
        <Route
          path="/games/ecosystem-balance"
          element={
            <ProtectedRoute>
              <EcosystemBalance />
            </ProtectedRoute>
          }
        />
        <Route
          path="/games/climate-hero"
          element={
            <ProtectedRoute>
              <ClimateHero />
            </ProtectedRoute>
          }
        />
        <Route
          path="/my-courses"
          element={
            <ProtectedRoute>
              <div>My Courses Page (Coming Soon)</div>
            </ProtectedRoute>
          }
        />
        <Route
          path="/profile"
          element={
            <ProtectedRoute>
              <div>Profile Page (Coming Soon)</div>
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
